import NavItem from 'react-bootstrap/esm/NavItem';
import '../App.css';
import tileImg from '../img/image.png';
import Button from 'react-bootstrap/Button';
import Nav from 'react-bootstrap/Nav';

function Home() {
  return (
    <div style={{display: 'flex', justifyContent: 'center', alignItems: 'center'}}>
        <header className='Home-header'>
            <h6 style={{marginLeft: 100, fontSize: 24}}>Транспонатор нот</h6>
            <div style={{display: 'flex', justifyContent: 'center', alignItems: 'center'}}>
                <Button style={{fontSize: 24, display: 'flex', justifyContent: 'center', alignItems: 'center', height: 35}}>Вход</Button>
                <Button style={{marginLeft: 15, marginRight: 100, fontSize: 24, height: 35, display: 'flex', justifyContent: 'center', alignItems: 'center'}}>Регистрация</Button>
            </div>
        </header>
        <main className='Home-body'>
            <h4 style={{marginTop: 30, fontSize: 32}}>Онлайн транспонирование нот</h4>
            <p style={{fontSize: 20}}>Ноты из любого произведения для любого инструмента</p>
            
            <div style={{ display: 'flex', justifyContent: 'center', marginBottom: 50}}>
                <div className='Home-tile'>
                    <Button className='Home-tile-button'>Загрузить файл</Button>
                    <p style={{color: '#C8C8C8'}}>Перетащите сюда MP3 файл. Максимальный размер файла - 78 мб</p>
                </div>
            </div>
        </main>
        <footer className='Home-footer'>говно</footer>
    </div>
  );
}

export default Home;
